import React from 'react';
import { Box, Button, Container, Typography, useTheme } from '@mui/material';

const Landing = () => {
    const theme = useTheme();

    return (
        <Box sx={{ background: theme.palette.landing.primaryGradient, py: 8 }}>
            <Container maxWidth="sm">
                <Typography 
                    variant="h2" 
                    align="center" 
                    sx={{ color: theme.palette.landing.text.primary }} 
                    gutterBottom
                >
                    Welcome to Slaughterhouse
                </Typography>
            </Container>
        </Box>
    );
};

export default Landing;
